import React, {useState, useContext} from 'react'
import SearchResult from './SearchResult'
import SampleData from './SampleData'
import {Context} from './Context'

const Result = () => {
    const {product} = useContext(Context)
    
    const newarr = []
    // for(let i = 0; i<2; i++){
    //  newarr.push(product.searchResult[0].item[i].galleryURL)
    //     }
    const Elements = product.map((item) => (
        <div>
            {item.searchResult[0].item.map((t) => (
                <SearchResult item={t.galleryURL} title={t.title} subtitle={t.subtitle} conditionDisplayName={t.conditionDisplayName} price={t.currentPrice.__value__} />
            ))
        }
        </div>

    ))
    return (
        <div >
            {Elements}
        </div>
    )
}

export default Result
